INSERT INTO `infopage` (`id`, `code`, `title`, `content`, `createTime`, `updateTime`, `createUserId`, `updateUserId`) VALUES
(2, 'delivery', 'Доставка и оплата', '<h1 style="margin-top: 0px; margin-bottom: 0.325em; padding: 0px; letter-spacing: -0.025em; line-height: 1.2em; font-size: 3.07692em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif;">Доставка и оплата</h1><article class="stress-info sprite-side" name="stress-info" effect_type="slide" style="margin: 0px 0px 2.5em; padding: 2em 3.53846em; position: relative; background-color: rgb(247, 251, 253); border: 1px solid rgb(197, 224, 247); border-radius: 4px; max-width: 57.8462em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif; font-size: 13.0013px;">Внимание!&nbsp;<br>Заказывая доставку товара сторонними курьерскими службами (Новая Почта, Мист Экспресс ) - при получении обязательно проверяйте наличие всего товара в заказе, а так же его внешний вид.<br>В случае повреждения товара, или неполной комплектации заказа - необходимо отказаться от получения товара и его оплаты, а так же составить акт(претензию) . В случае если данная ситуация будет иметь место - обязательно сообщите нам о случившемся по тел: (044) 537-02-22, (044) 503-80-80, 0 800 503-808<br><br><br>Из-за напряженной ситуации в восточном регионе, временно приостановлена доставка товаров в г. Донецк и г. Луганск.<br>Вместе с тем сильно ограничена и задерживается доставка по Луганской и Донецкой областям.&nbsp;<br><br>Пневматическое оружие, оружие под патрон Флобера и аксессуары к нему, а также ножи, мультитулы, туристические газовые баллоны и картриджи в данный момент не доставляются в Донецкую и Луганскую области.</article><section class="service-box" style="margin: 0px 0px 5em; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif; font-size: 13.0013px;"><a name="delivery_methods" style="outline: none;"></a><h3 class="service-title" style="margin: 0px 0px 0.52632em; padding: 0px; letter-spacing: -0.015em; line-height: 1.15789em; font-size: 1.46154em;">Способы доставки</h3><ul class="service-l" style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 1em; list-style: none;"><li class="service-l-i" style="margin: 1.84615em 0px; padding: 0px 2.30769em 0px 0px; display: inline-block; width: 228px; vertical-align: top;"><a class="service-l-i-link novisited" id="delivery_button_2" href="http://rozetka.com.ua/payments-and-deliveries/#" style="outline: none; color: rgb(62, 119, 170);"><img class="service-l-i-img" src="http://i2.rozetka.ua/deliveries_services/info/0/7.png" alt="" style="margin: 0px 0px 0.76923em; padding: 0px; cursor: pointer; display: block;"><span class="service-l-i-text xhr" style="border-bottom: 1px dotted; font-size: 1.15385em; line-height: 1.3em;">Новая Почта</span></a><p class="service-description" style="margin-top: 1.07692em; margin-bottom: 0px; padding: 0px; line-height: 1.5em; font-size: 0.92308em;">Доставка в отделение Новой Почты<br><br>С помощью доставки Новой Почтой, Вы можете получить товар даже в самых отдаленных уголках Украины.</p></li>&nbsp;<li class="service-l-i" style="margin: 1.84615em 0px; padding: 0px 2.30769em 0px 0px; display: inline-block; width: 228px; vertical-align: top;"><a class="service-l-i-link novisited" id="delivery_button_4" href="http://rozetka.com.ua/payments-and-deliveries/#" style="outline: none; color: rgb(62, 119, 170);"><img class="service-l-i-img" src="http://i1.rozetka.ua/deliveries_services/info/0/47.png" alt="" style="margin: 0px 0px 0.76923em; padding: 0px; cursor: pointer; display: block;"><span class="service-l-i-text xhr" style="border-bottom: 1px dotted; font-size: 1.15385em; line-height: 1.3em;">Адресная доставка по Киеву</span></a><p class="service-description" style="margin-top: 1.07692em; margin-bottom: 0px; padding: 0px; line-height: 1.5em; font-size: 0.92308em;">Доставка курьером по адресу&nbsp;<br><br>Доставка производится до входа в здание<br>Стоимость доставки 35 грн</p></li>&nbsp;<li class="service-l-i" style="margin: 1.84615em 0px; padding: 0px 2.30769em 0px 0px; display: inline-block; width: 228px; vertical-align: top;"><a class="service-l-i-link novisited" id="delivery_button_6" href="http://rozetka.com.ua/payments-and-deliveries/#" СЦ="" Точка"''}]});"="" style="outline: none; color: rgb(62, 119, 170);"><img class="service-l-i-img" src="http://i2.rozetka.ua/deliveries_services/info/0/27.png" alt="" style="margin: 0px 0px 0.76923em; padding: 0px; cursor: pointer; display: block;"><span class="service-l-i-text xhr" style="border-bottom: 1px dotted; font-size: 1.15385em; line-height: 1.3em;">Мист Экспресс. Пункт выдачи "СЦ Точка"</span></a><p class="service-description" style="margin-top: 1.07692em; margin-bottom: 0px; padding: 0px; line-height: 1.5em; font-size: 0.92308em;">Доставка в пункт выдачи "Мист Экспресс" ("Точка").<br><br>Пункты выдачи "Мист Экспресс" ("Точка") находятся во всех областных центрах, а так же во Владимире-Волынском, Кременчуге и Кривом Роге<br></p></li><li class="service-l-i" style="margin: 1.84615em 0px; padding: 0px 2.30769em 0px 0px; display: inline-block; width: 228px; vertical-align: top;"><a class="service-l-i-link novisited" id="delivery_button_7" href="http://rozetka.com.ua/payments-and-deliveries/#" style="outline: none; color: rgb(62, 119, 170);"><img class="service-l-i-img" src="http://i1.rozetka.ua/deliveries_services/info/0/59.png" alt="" style="margin: 0px 0px 0.76923em; padding: 0px; cursor: pointer; display: block;"><span class="service-l-i-text xhr" style="border-bottom: 1px dotted; font-size: 1.15385em; line-height: 1.3em;">Мист Экспресс</span></a><p class="service-description" style="margin-top: 1.07692em; margin-bottom: 0px; padding: 0px; line-height: 1.5em; font-size: 0.92308em;">Доставка курьером на дом</p></li>&nbsp;<li class="service-l-i" style="margin: 1.84615em 0px; padding: 0px 2.30769em