(3, 'order_create', 'Как сделать заказ', '<h1 style="margin-top: 0px; margin-bottom: 0.325em; padding: 0px; letter-spacing: -0.025em; line-height: 1.2em; font-size: 3.07692em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif;">Условия использования сайта</h1><div class="text-page" style="font-size: 1.15385em; line-height: 1.4em; max-width: 60em; margin-bottom: 5em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif;"><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Внимание! Перед просмотром этого сайта внимательно прочитайте данные условия. Если вы не согласны с этими условиями, не используйте этот сайт.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><b>Использование сайта</b></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Сайт Rozetka.ua (далее «Розетка») разрешает вам просматривать и загружать материалы этого сайта (далее «Сайт») только для личного некоммерческого использования, при условии сохранения вами всей информации об авторском праве и других сведений о праве собственности, содержащихся в исходных материалах и любых их копиях. Запрещается изменять материалы этого Сайта, а также распространять или демонстрировать их в любом виде или использовать их любым другим образом для общественных или коммерческих целей. Любое использование этих материалов на других сайтах или в компьютерных сетях запрещается.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><b>Oтказ от ответственности</b></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Материалы и услуги этого сайта предоставляются «как есть» без каких-либо гарантий. Розетка не гарантирует точности и полноты материалов, программ