о любое ваше сообщение Розетка может удалять без вашего на то согласия, а также безвозмездно использовать по своему усмотрению. Розетка не несет ответственности за любую информацию размещенную пользователями Сайта.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><b>Использование персональных данных</b></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Мы используем различные технологии для сбора и хранения информации, когда вы посещаете сайт Розетка (<a target="_blank" href="http://rozetka.com.ua/user_terms/personal_data/" style="outline: none; color: rgb(157, 95, 175);">подробнее о защите и обработке персональных данных</a>). Это может включать в себя запись одного или нескольких куки или анонимных идентификаторов. Мы также используем куки и анонимные идентификаторы, когда вы взаимодействуете с услугами, предложенными нашими партнерами, такими как рекламные услуги, например, которые могут появиться на других сайтах.<span id="copyinfo" style="font-size: 1em; line-height: 1.4em; position: absolute; overflow: hidden; width: 1px; height: 1px;"><br>Подробнее:&nbsp;<a href="http://rozetka.com.ua/terms/" style="outline: none; color: rgb(157, 95, 175);">http://rozetka.com.ua/terms/</a></span><div><br></div></p></div>', '2016-11-06 20:27:41', '2016-11-27 13:38:02', 1, 1);
