(5, 'discount_system', 'Система скидок', '<h1 style="margin-top: 0px; margin-bottom: 0.325em; padding: 0px; letter-spacing: -0.025em; line-height: 1.2em; font-size: 3.07692em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif;">Подарочные сертификаты</h1><div class="text-page" style="font-size: 1.15385em; line-height: 1.4em; max-width: 60em; margin-bottom: 5em; color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif;"><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;"><a href="http://rozetka.com.ua/giftcertificate/c90374/" class="novisited" style="outline: none; color: rgb(62, 119, 170);">Подарочный сертификат в виде пластиковой карты</a>&nbsp;— это предварительный платеж, который дает возможность приобретать товары, на сумму эквивалентную его номиналу.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><span style="font-size: 1em; line-height: 1.4em;">Преимущества подарочных сертификатов</span></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Приобретая подарок , Вы все равно рискуете ошибиться во вкусах, деталях, каких то не раскрытых желаниях человека, которому Вы хотите принести радость. Разумеется, Ваше внимание будет оценено, однако удовольствие от самого подарка будет неполным, а в этом ведь и состоит смысл подарка - радовать и приносить пользу. Даря сертификат, Вы можете быть уверены на 100% — ведь с помощью сертификата человек сможет выбрать именно то, что ему нужно.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><span style="font-size: 1em; line-height: 1.4em;">Преимущества покупки сертификатов в нашем магазине</span></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Не распыляясь на большое количество текста, просто сухие цифры — это более 75000 наименований товаров, находящихся в наличии на момент написания данного текста. Цифра колеблющаяся в зависимости от сезонного состояния нашего склада и растущая в геометрической прогрессии в связи с открытием новых направлений — музыкальные инструменты,- автотовары, - спортивное питание, - современный дом и все необходимое. Просто вернитесь на главную страницу и еще раз внимательно посмотрите на разделы.</p><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">Определившись с номиналом сертификата, просто оформите его заказ по телефону или через интернет и сохраните свое драгоценное время. Все сертификаты Вы приобретаете по номинальной стоимости, равной их стоимости в рознице. Срок действия сертификата указан на обороте пластиковой карточки.</p><br><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold;"><span style="font-size: 1em; line-height: 1.4em;">Корпоративным клиентам</span></h4><p style="margin-bottom: 1em; padding: 0px; line-height: 1.4em; font-size: 1em;">С помощью наших сертификатов Вы сможете сделать подарки любому количеству сотрудников и деловых партнеров, включая тех, кто находится в других городах Украины. Широчайшая продуктовая линейка и ценовой диапазон представляемых нами товаров на любой вкус и достаток . К Вашим услугам большой выбор номиналов и категорий сертификатов.</p></div><div style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, FreeSans, &quot;Liberation Sans&quot;, &quot;Nimbus Sans L&quot;, sans-serif; font-size: 13.0013px; text-align: center;"><table width="" align="center" style="margin: 0px; padding: 0px;"><tbody style="margin: 0px; padding: 0px;"><tr style="margin: 0px; padding: 0px;"><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate50/p90376/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/19.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate500/p90381/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/22.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td></tr><tr style="margin: 0px; padding: 0px;"><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate100/p90379/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/20.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate1000/p90382/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/23.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td></tr><tr style="margin: 0px; padding: 0px;"><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate200/p90380/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/21.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td><td style="margin: 0px; vertical-align: top;"><a href="http://rozetka.com.ua/gift_caertficate2000/p90383/" style="outline: none; color: rgb(157, 95, 175);"><img src="http://i.rozetka.ua/pages/0/24.jpg" title="" alt="" border="0" style="margin: 0px; padding: 0px; cursor: pointer;"></a><br></td></tr></tbody></table><br><div class="text-page" style="font-size: 1.15385em; line-height: 1.4em; max-width: 60em; margin-bottom: 5em;"><h4 style="margin: 0px 0px 0.7em; padding: 0px; font-size: 1em; line-height: 1.4em; font-weight: bold; text-align: left;"><span style="font-size: 1em; line-height: 1.4em;">Правила использования подарочного сертификата (далее "сертификат"):</span><br></h4><div style="text-align: left;">1. Подарочный сертификат является сертификатом на предъявителя (не является именным), и любое физическое лицо, предъявившее сертификат, может приобрести с его помощью товар предлагаемый компанией Розетка. Сертификат не распостраняется на товары других продавцов.<br>В случае утраты сертификата, в том числе хищения, сертификат не может быть восстановлен, и денежные средства не могут быть возвращены, в связи с отсутствием персонификации лица, владевшего сертификатом до утраты.<br><br>2. При оплате заказа с помощью сертификата обязательно укажите это на этапе оформления и сообщайте менеджеру при подтверждении заказа. Сертификат должен быть предъявлен и передан сотруднику компании при оплате товара.&nbsp;<br><br>3. Срок действия Сертификата ограничен и составляет 6 месяцев с даты выдачи.<br><br>4. С использованием сертификата возможна единственная покупка. При совершении покупки номинал сертификата списывается целиком. В случае, если стоимость покупки меньше номинала сертификата, разница между стоимостью не возвращается.&nbsp;<br><br>5. При возврате товара, купленного с использованием сертификата, возврат средств осуществляется на новый сертификат аналогичного номинала.<br><br>6. В случае, если стоимость покупки превышает номинал, разница между стоимостью товара и номиналом сертификата оплачивается наличными денежными средствами.<br><br>7. Покупка сертификата возможна только при наличном способе оплаты.<br><br>8. Сертификат не может быть использован для получения наличных денежных средств.<br><br>9. Оплатить товары с помощью сертификата, могут только физические лица. Юридические лица не могут частично или полностью оплатить приобретение товаров сертификатами.<br><br>10. Покупателю следует сохранять чек на покупку сертификата для подтверждения номинала карты в случае повреждения или иных спорных ситуаций.<span id="copyinfo" style="font-size: 1em; line-height: 1.4em; position: absolute; overflow: hidden; width: 1px; height: 1px;"><br>Подробнее:&nbsp;<a href="http://rozetka.com.ua/gift/" style="outline: none; color: rgb(157, 95, 175);">http://rozetka.com.ua/gift/</a></span></div></div></div>', '2016-11-06 20:28:33', '2016-11-27 13:35:12', 1, 1);
